import hero_image from "../../../../assets/images/hero_image.png";
import gdg_image from "../../../../assets/images/gdg.png";
import react_ke from "../../../../assets/images/reactke.png";
import kamilimu from "../../../../assets/images/kamilimu.png";
import cytonn from "../../../../assets/images/cytonn.png";
import osca from "../../../../assets/images/osca.png";

function HeroSection() {
  return (
    <section className="text-gray-600 body-font">
      <div className="container mx-auto flex px-5 py-12 md:flex-row flex-col items-center">
        <div className="lg:flex-grow md:w-1/2 lg:pr-24 md:pr-16 flex flex-col md:items-start md:text-left items-center text-center">
          <h1 className="title-font sm:text-4xl text-3xl mb-4 font-medium text-gray-900">
            Accelerate your <span className="text-[#00664E]">growth</span> and
            unlock your potential in the tech ecosphere
          </h1>
          <p className="mb-8 leading-relaxed">
            The fastest growing Africa, open-source community looking to change
            the way young Africans get started in technology.
          </p>
          <div className="flex justify-center">
            <button className="inline-flex  text-white bg-primary border-0 py-3 px-8 focus:outline-none  rounded-lg text-lg">
              Join the community
            </button>
          </div>
          <div className="w-full py-4 mt-8 border-y-2 border-l-[#00664E]">
            <h1 className="text-2xl md:text-3xl font-bold">Our Partners</h1>
            {/* patner logos  */}
            <div className="grid grid-cols-3 gap-8 text-gray-500 sm:gap-12 md:grid-cols-6 lg:grid-cols-6 mt-4">
              {/* logo 1  */}
              <div className="flex justify-center items-center">
                <svg
                  width={40}
                  height={41}
                  viewBox="0 0 40 41"
                  fill="none"
                  xmlns="http://www.w3.org/2000/svg"
                  xmlnsXlink="http://www.w3.org/1999/xlink"
                >
                  <rect y="0.5" width={40} height={40} fill="url(#pattern0)" />
                  <defs>
                    <pattern
                      id="pattern0"
                      patternContentUnits="objectBoundingBox"
                      width={1}
                      height={1}
                    >
                      <use
                        xlinkHref="#image0_1038_7320"
                        transform="scale(0.00205761)"
                      />
                    </pattern>
                    <image
                      id="image0_1038_7320"
                      width={486}
                      height={486}
                      xlinkHref="data:image/jpeg;base64,"
                    />
                  </defs>
                </svg>
              </div>

              {/* logo 2  */}
              <div className="flex justify-center items-center">
                <img
                  className="object-cover object-center"
                  alt="gdg"
                  src={gdg_image}
                />
              </div>
              {/* logo 3  */}
              <div className="flex justify-center items-center">
                <img
                  className="object-cover object-center"
                  alt="react-ke"
                  src={react_ke}
                />
              </div>
              {/* logo 4  */}
              <div className="flex justify-center items-center">
                <img
                  className="object-cover object-center"
                  alt="kamilimu"
                  src={kamilimu}
                />
              </div>
              {/* logo 5  */}
              <div className="flex justify-center items-center">
                <img
                  className="object-cover object-center"
                  alt="cytonn"
                  src={cytonn}
                />
              </div>
              {/* logo 6 */}
              <div className="flex justify-center items-center">
                <img
                  className="object-cover object-center"
                  alt="osca"
                  src={osca}
                />
              </div>
            </div>
          </div>
        </div>
        <div className="hidden md:block lg:max-w-lg lg:w-full md:w-1/2 w-5/6">
          <img
            className="object-cover object-center rounded"
            alt="hero"
            src={hero_image}
          />
        </div>
      </div>
    </section>
  );
}

export default HeroSection;
